ks.x:
var $bm_rt;
var t1, t2, span, delta, t;
if (numKeys > 1 && time > key(numKeys).time) {
    t1 = key(1).time;
    t2 = key(numKeys).time;
    span = $bm_sub(t2, t1);
    delta = $bm_sub(time, t2);
    t = $bm_mod(delta, span);
    $bm_rt = valueAtTime($bm_sum(t1, t));
} else {
    $bm_rt = value;
}

